import './testimonial.css'
import React from 'react'

const Testimonial = () => {
    return (  
        <div className="mb-32">
            <p className="quote text-6xl">Not only creatively exceptional, the attention to detail and the focus on what the user needs sets him apart from the competition. Friendly, insightful and a pleasure to work with.</p>
            <p class="name text-5xl mt-8">Chris van Aurich,Flock</p>
        </div>
     );
}
 
export default Testimonial;
